#Ashtangamondays – August Schedule 🌱☀️🌸
.
AshtangaMondays is a different kind of challenge – a playground for both new and experienced Ashtangis to practice together like we do in the shala, learning from each other and sharing our love for the practice.

Each month we announce a schedule for every upcoming Monday. You can choose to participate one month or every month - it’s totally up to you!

How to join in:  just repost this flyer, follow the hosts and sponsors, and check in with the hosts for their weekly post. Join in each week with a video or a picture from your practice, and remember to tag the hosts and use #AshtangaMondays in your post so we can see you 👀♥️

August Schedule:
Monday 2nd - Janusirsasana A 
Monday 9th –  Janusirsasana B
Monday 16th- Janusirsasana C
Monday 23rd - Marichyasana A
Monday 30th - Marichyasana B

